import React, { Component } from 'react';

class Header extends Component {
    render() { 
        return ( 
            <div>
                <button className="btn btn-dark">Battle</button>


                <button className="btn btn-dark">Followers</button>
                <button className="btn btn-dark">Repositories</button>

                <button className="btn btn-dark">JavaScript</button>
                <button className="btn btn-dark">Java</button>
                <button className="btn btn-dark">Python</button>
                <button className="btn btn-dark">PHP</button>

            </div>
         );
    }
}

export default Header;
